import React, { useState } from 'react';
import axios from 'axios';
import '../index.css';
import { useNavigate } from 'react-router-dom';

const Top: React.FC = () => {
  const url = "/works";

  const LogoutSubmit = async (e: React.FormEvent) => {
    e.preventDefault();

    const url: string = "/users/logout/" + localStorage.getItem('user_id');

    try {
      await axios.post(url, {
        login_id: loginId,
        password: password,
      })
      .then((response) => {
        localStorage.setItem('user_id', response.data.id);
        navigate("/");
      });
    } catch (error) {
      console.error(error);
    }
  }

  return (

    <div className="App">
      <h1 className="bg-gray-300">Users</h1>
      <ul>
        {users.map((user: User, index: number) => (
          <li key={index}>{user.name}</li>
        ))}
      </ul>
      <div>{localStorage.getItem("user_id")}</div>
    </div>
  );
}

export default Top;
